import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-loguin',
  templateUrl: './loguin.page.html',
  styleUrls: ['./loguin.page.scss'],
})
export class LoguinPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

<ion-content>
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back" routerLink="/welcome"></ion-icon>
      <div id="logo">
        <img src="assets/icon/logoone.png" alt="" />
      </div>
      <div></div>
    </div>

    <h1>Sign In</h1>
    <p>Sign in to discover amazing thing noar <br/>around you</p>
  </div>
</ion-content>
